import React from "react";
import Card from "./Card";
import logoCRYG from "../img/logoCRYG.png"
import logoDEL from "../img/logoDEL.png"

const Content = function () {
    return (
        <div className="content">
            <div className="title">
                <span className="activeLabel">Swap</span>
                <span className="disableLabel">Pools</span>
            </div>
            <div className="cards">
                <Card status={"unactiveCard"} order={"Вы продаете"} imgCurrency={logoCRYG} currencyName={"CRYG"} sum={"1"} converSum={"~$333.73"}/>
                <Card status={"activeCard"} order={"Вы покупаете"} imgCurrency={logoDEL} currencyName={"DEL"} sum={"714.543016"} converSum={"~$331.62 (-0.63%)"}/>
            </div>

        </div>
    )
}
export default Content;
